import React from "react";
// import "./HeaderArea.css";
import {FaYoutube} from 'react-icons/fa';
import {MdHome, MdSearch, MdVideoCall, MdViewComfy} from 'react-icons/md';
import {AiTwotoneBell} from 'react-icons/ai';
import { HiMicrophone } from "react-icons/hi";

function BottomNav() {
    return (
        <div className="d-flex justify-content-between fixed-bottom bg-primary">
                <a className="btn btn-default text-center" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Home</span></a>
                <a className="btn btn-default text-center" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Shorts</span></a>
                <a className="btn btn-default text-center" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Notification</span></a>
        </div>
    );

}


export default BottomNav;
